const BookingDetails = ({ booking }) => {
    if (!booking) return <p className="text-center text-muted">Tidak ada pemesanan aktif.</p>;
  
    return (
      <div>
        <h2 className="text-center">Rincian Pemesanan</h2>
        <ul className="list-group">
          <li className="list-group-item">Nama: {booking.name}</li>
          <li className="list-group-item">Nomor Kendaraan: {booking.vehicle}</li>
          <li className="list-group-item">Durasi: {booking.duration} jam</li>
        </ul>
      </div>
    );
  };
  
  export default BookingDetails;
